import gql from 'graphql-tag';

export const mainQuery = gql`{
    Artist {
      Name
      ArtistId
    }
    Album {
      Title
      AlbumId
    }
  }
  `;

export const mainQueryRead = gql`
Artist {
      Name
      ArtistId
    }
    Album {
      Title
      AlbumId
    }
  }
`;
